INSERT INTO `activities` VALUES ('158', '飞羽与树林的寻寻觅觅——生态园大圳浦观鸟活动', '2018-03-25 07:00:00', '生态园大圳埔湿地', '2018-03-24 05:00:00', '30', '2018-03-25 10:00:00', '   你喜欢鸟吗？你了解鸟吗？你知道鸟类应对飞翔的身体改造过程和经历吗？你是否留意鸟的喙和食物有很多的关系？鸟类是怎么谈恋爱的？小鸟叽叽喳喳在说什么？……<br/>\r\n   本次活动中，郭老师从观察鸟类入手，一起探寻鸟类的生活奥秘。带你走进生态园大圳浦湿地，那里是鸟类的乐园，小小的区域内常见鸟类有50多种。郭老师将带你认识这些鸟类，同时还会引人入胜的讲解鸟类的语言、肢体动作和求偶繁殖等知识，以及与鸟类与植物之间的亲密关系。<br/>\r\n集合地点：生态园大圳埔湿地停车场<br/>\r\n\r\n', '陈同学', '13829139636', '0');
INSERT INTO `activities` VALUES ('159', '花花与虫虫的爱恨情仇——走进松山湖中学内外的昆虫世界', '2018-03-25 03:00:00', '东莞中学松山湖学校', '2018-03-24 05:00:00', '30', '2018-03-25 05:00:00', '   在漫长的大自然进化过程中，昆虫与花朵的生活之间建立了千丝万缕、极为复杂的联系。<br/>\r\n   本次活动在松山湖中学的校外和校内举行：首先带领大家走进校园外空旷的荒野里，让大家熟悉和认识纯自然状态下昆虫世界以及植物花朵，再让大家走进松山湖中学校园内，寻找老师藏好的各种昆虫，也许你能看到羽化成蝶的全过程，最后走进实验室，欣赏微观视觉下的昆虫的奇妙结构。在这个过程中，郭老师会讲解昆虫与植物之间进化关系，一起来了解花花与虫虫之间的“爱恨情仇”。<br/>\r\n集合地点：东莞中学松山湖中学北门<br/>\r\n\r\n', '陈同学', '13829139636', '0');
INSERT INTO `activities` VALUES ('160', '夜幕下神秘的小精灵——松山湖夜观活动', '2018-03-25 19:00:00', '东莞理工学院', '2018-03-24 17:00:00', '20', '2018-03-25 21:00:00', '&emsp; &emsp;月色溶溶夜，蛙鸣花草香。进入春季，大自然呈现更加生机勃勃的一面，夜色中的大自然也有着另类的美丽和神秘。本次活动选在松山湖东莞理工学院校园内举行。届时我们还会通过一定措施吸引昆虫，还会寻找青蛙和其他小动物。一起来跟郭老师探寻夜间神秘的小精灵吧，认识奇妙的自然世界。<br/>\r\n集合地点：东莞中学松山湖中学北门<br/>\r\n', '陈同学', '13829139636', '0');
INSERT INTO `activities` VALUES ('168', '晨起鸟鸣，带你欣赏东莞飞羽', '2018-04-14 08:00:00', '东莞理工学院', '2018-04-13 17:00:00', '100', '2018-04-14 11:00:00', '<p>&emsp;&emsp;&nbsp;&ldquo;春眠不觉晓，处处闻啼鸟。&rdquo;春天是鸟儿繁殖的季节，也是鸟儿最活跃的季节，它们有的忙着奔走迁徙，有的正欢歌鸣唱，有些则准备着筑巢了，有的正在哺育着鸟宝宝&hellip;<br />\r\n&emsp;&emsp;我们在车水马龙的城市中生活，平日里行走匆匆，根本无暇欣赏身边鸟儿这些有趣的场景、它们绚丽的鸟羽和动听的歌声。所以，今天请你放慢脚步，跟随东莞的观鸟达人，去寻找与探访善于模仿声音，号称情歌王子的乌鸫；像人类一样，头发会慢慢变白的白头鹎；有着酷帅高发髻造型的红耳鹎；爱翘尾巴、黑白分明的鹊鸲；全身雪白的小白鹭&hellip;&hellip;<br />\r\n&emsp;&emsp;一个不一样、多彩有趣的鸟类世界正等待着你去发现与认识！<br />\r\n<br />\r\n[温馨提醒]<br />\r\n1、本次活动谢绝空投！！！请按照实际报名人员来填报。<br />\r\n2、7:40-8:00签到，八点集合，请准时到达！<br />\r\n3、公益活动，一切风险要自己承担！每位孩子需有一位家长陪同参与。<br />\r\n4、请自备望远镜，建议穿绿色、军绿色、迷彩服、浅蓝色等接近自然色的服装，拒绝穿艳丽颜色的衣服。<br />\r\n5、自备水杯和背包，带一个记事本和一支笔。</p>\r\n\r\n<p>6、自行开车的车主请导航东莞理工学院体育中心（玉兰路）、从学校北门进入，并告诉保安参加观鸟活动。</p>\r\n\r\n<p>&nbsp;</p>\r\n', '陈同学', '13829139636', '0');
INSERT INTO `activities` VALUES ('180', 'hey,小科学家，快来帮我们检测燕岭湿地吧！', '2018-04-15 08:30:00', '燕岭湿地', '2018-04-14 18:00:00', '23', '2018-04-15 11:30:00', '<p>1、介绍燕岭湿地大厅国家湿地公园概况以及讲解湿地活动目的，并开展问卷调查。</p>\r\n\r\n<p>2、沿途参观水系综合治理工程，收集湿地各个水源。</p>\r\n\r\n<p>3、检测收集到的水，进行对比实验并对其检测结果进行讲解。</p>\r\n\r\n<p>4、根据问卷调查情况，对获奖情况进行处理并派发奖品。</p>\r\n', '曾振宇', '18575296690', '0');
INSERT INTO `activities` VALUES ('183', 'hey,小科学家，快来帮我们检测燕岭湿地吧！', '2018-04-22 08:30:00', '燕岭湿地', '2018-04-20 18:00:00', '20', '2018-04-22 11:30:00', '<p>1、介绍燕岭湿地大厅国家湿地公园概况以及讲解湿地活动目的，并开展问卷调查。</p>\r\n\r\n<p>2、沿途参观水系综合治理工程，收集湿地各个水源。</p>\r\n\r\n<p>3、检测收集到的水，进行对比实验并对其检测结果进行讲解。</p>\r\n\r\n<p>4、根据问卷调查情况，对获奖情况进行处理并派发奖品。</p>\r\n', '曾振宇', '18575296690', '0');
INSERT INTO `activities` VALUES ('184', '燕岭湿地土壤世界探秘，小科学家们快来啊！', '2018-05-05 09:00:00', '燕岭湿地', '2018-05-04 18:00:00', '20', '2018-05-05 11:30:00', '<p>参观燕岭湿地展览馆</p>\r\n\r\n<p>分组参观燕岭湿地并进行土壤监测</p>\r\n\r\n<p>分析对比监测结果，进行知识有奖竞猜</p>\r\n\r\n<p>合照留念</p>\r\n', '朱启帆', '15916774572', '0');
INSERT INTO `activities` VALUES ('185', '美丽精灵与自然共生，邀您共欣赏', '2018-05-27 06:30:00', '松山湖高新技术开发区管理委员会', '2018-05-25 17:00:00', '20', '2018-05-27 09:30:00', '<p>&nbsp; &nbsp; &nbsp; &nbsp; 昨天还是桃红柳绿的春季，今天就到郁郁葱葱的初夏。如少女般的火焰花，蓝色精灵的蓝花楹，亭亭玉立的荷花...已经悄然盛开。美丽的精灵活跃在这生机勃勃的大自然中，充满着无穷的奥秘和无限的情趣。</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; 经过多年的生态建设，松山湖管委会已经绿树成荫，成为鸟儿们居住的好去处。蓝天上，美丽的鸟儿在飞翔，树林间，鸟儿在啾啾的歌唱。喜欢这些美丽动人的小家伙的你们，请拿起望远镜，一起来奔赴松山湖管委会，听现场观鸟专家讲解户外观鸟技巧吧！</p>\r\n', '林桂东', '13423197807', '0');
INSERT INTO `activities` VALUES ('187', '2018年东莞节能低碳宣传活动', '2018-06-10 10:00:00', '东莞松山湖万科生活广场', '2018-06-09 17:00:00', '300', '2018-06-10 12:00:00', '<p>低碳节能互动体验。</p>\r\n', '刘美林', '18824669767', '0');
INSERT INTO `activities` VALUES ('188', '燕岭湿地自然解说员培训', '2018-06-16 09:00:00', '东莞国家城市湿地公园（燕岭湿地）', '2018-06-15 17:00:00', '20', '2018-06-16 16:30:00', '<p>活动主题：燕岭湿地自然解说员培训</p>\r\n\r\n<p>主办单位：东莞松山湖绿色低碳发展促进中心</p>\r\n\r\n<p>协办单位：东莞理工学院</p>\r\n\r\n<p>活动时间：2018年6月16日上午9:00-下午4:30</p>\r\n\r\n<p>活动地点：东莞国家城市湿地公园</p>\r\n\r\n<p>招募人员：20人</p>\r\n\r\n<p>【活动对象】</p>\r\n\r\n<p>1、年龄满18周岁以上；</p>\r\n\r\n<p>2、热爱自然，守护自然，对自然教育感兴趣；</p>\r\n\r\n<p>3、拥有参与学习自然观察及环境教育的热枕；</p>\r\n\r\n<p>4、担任人与自然的桥梁，有意向成为自然教育讲解员；</p>\r\n\r\n<p>5、持续学习成为自然生态导师；</p>\r\n\r\n<p>6、每个单位报名不能超过2人。</p>\r\n\r\n<p>【活动目标】</p>\r\n\r\n<p>1、让志愿者具备基本的自然观察能力；</p>\r\n\r\n<p>2、让志愿者剧本基本的自然体验活动设计概念；</p>\r\n\r\n<p>3、希望在达到上述两个目标后，让志愿者团队能自行办理面向群众的活动。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('189', '寂静林中悦动精灵-松湖广场昆虫导赏活动', '2018-08-12 08:00:00', '松湖广场', '2018-08-10 12:00:00', '20', '2018-08-12 10:30:00', '<p>活动内容：</p>\r\n\r\n<p>1、认识松湖广场中常见的昆虫及其寄主；</p>\r\n\r\n<p>2、基本了解蝴蝶的生长发育过程；</p>\r\n\r\n<p>3、昆虫与环境间的关系；</p>\r\n\r\n<p>4、学会手绘昆虫的方式</p>\r\n\r\n<p>注意事项：大人和小孩需要同时报名，并且一个儿童必须要有一名家长陪同，儿童年龄在8岁以上。需要穿长衣长袖，自备水，铅笔，笔，望远镜，</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('190', '跟着绘本走进自然', '2018-08-19 09:40:00', '松山湖图书馆', '2018-08-16 12:00:00', '50', '2018-08-19 12:00:00', '<p>跟着米菲老师，共同欣赏绘本《大地的窗口》。</p>\r\n\r\n<p>在《大地的窗口》一书中，古道尔博士记载了一个她与黑猩猩的传奇故事。在这个故事里，黑猩猩们展示着自己独特的智慧、家庭的温情和残酷的族群斗争。在古道尔博士的眼中，黑猩猩不是那些在动物园中呆滞的望着游人的行尸走肉，而是有着自己鲜明个性的生灵。它们有着自己的名字，自己的性格，它们有着自己的喜怒哀乐，在黑猩猩的世界里，古道尔博士既是一个旁观者，也是被黑猩猩族群接纳的朋友。<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('191', '东莞市水污染治理和水生态修复科普讲座和技术交流会', '2018-08-21 09:00:00', '东莞松山湖礼宾路1号管委会B3栋隔层会议室', '2018-08-21 08:00:00', '30', '2018-08-21 12:00:00', '<p>上海海洋大学生态学教授就水生态修复理论、技术和实践等方面进行专业讲解，并现场与参会人员互动交流</p>\r\n', '黄工', '18098238395', '0');
INSERT INTO `activities` VALUES ('192', '自然观察的技巧与案例分享', '2018-09-08 14:40:00', '东莞理工学院（松山湖校区）', '2018-09-07 16:00:00', '100', '2018-09-08 17:00:00', '<p>大自然的智慧无处不在</p>\r\n\r\n<p>蜘蛛在林间通道，巧妙地编制性韧性高又无色透明的天罗地网，躲在暗处等待食物的自投罗网。凤蝶幼虫假装一坨屎逃避鸟的捕杀；马陆受到惊扰马上卷起使用硬硬的外壳保护自己；红蚂蚁利用视觉和超强大脑记忆力能够沿路返回；......</p>\r\n\r\n<p>我相信，只有我们认识到大自然的智慧，我们才会更加发自内心地敬畏自然、尊重生命；自发地停止破坏环境的行为，自发地维护生态系统的平衡。</p>\r\n\r\n<p>自然观察就是一把开启孩子了解大地的窗口的重要钥匙，那么，如何进行自然观察呢？快来参加我们的互动，大咖来与你面对面分享经验。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('193', '从自然观察到阅读写作', '2018-10-20 14:30:00', '东莞理工学院（松山湖校区）', '2018-10-19 16:00:00', '100', '2018-10-20 17:00:00', '<p>带领孩子做自然观察，再用文字的方式表达出来，是帮助孩子们对自己的观察进行思考、梳理。作为大人的我们，需要思考的是如何引导孩子进行观察，观察的内容是什么，如何获取讯息整合，如何进行思辨，如何扩展想象空间。写作是表达的一种方式，需要个性化想象的运化，才能成就为独特鲜活的作品。写作是输出，需要经过观察、阅读的积累与沉淀。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('194', '那些与鸟儿有关的事情', '2018-09-09 09:00:00', '东莞理工学院（松山湖校区）', '2018-09-07 16:00:00', '100', '2018-09-09 12:00:00', '<p>听资深观鸟达人信天翁讲述那些与鸟儿有关的事情。1）鸟的故事；2）观鸟的经验分享；3）相似鸟类的识别；4）鸟儿的保护工作，我们能够做些什么？</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('195', '燕岭湿地的“诗”情“画”意，等你来描绘', '2018-09-15 09:00:00', '燕岭湿地', '2018-09-14 16:00:00', '32', '2018-09-15 12:00:00', '<p>首先参加湿地科普展，实地参观和了解东莞国家城市湿地公园垂直流湿地在污水深度处理和水生态修复的原理和工艺过程等。然后参加燕岭湿地诗情画意活动。在该活动中，将领略新的自然画创作，如果你想挑战高难度的，将诗歌与自然物相结合，创作出您心中的美图，最后一起来跟父母创作一幅诗情画意带回家吧，并且您会收到一份神秘礼物哦！</p>\r\n', '陈盈莹', '13538392443', '0');
INSERT INTO `activities` VALUES ('196', '湿地植物铭牌等你挂，自然游戏等你玩', '2018-09-15 09:00:00', '燕岭湿地', '2018-09-14 16:00:00', '40', '2018-09-15 12:00:00', '<p>首先参观湿地科普展，实地参观和了解东莞国家城市湿地公园垂直流湿地在污水深度处理和水生态修复的原理和工艺过程等，然后参加植物名牌有你挂活动，老师对植物进行讲解后进行生态游戏（邂逅一棵树/猜猜我是谁），最后进行总结分享</p>\r\n', '陈盈莹', '13538392443', '0');
INSERT INTO `activities` VALUES ('197', '身体照相机：用感官记录燕岭最美风景', '2018-09-15 09:00:00', '燕岭湿地', '2018-09-14 16:00:00', '30', '2018-09-15 12:00:00', '<p>首先湿地科普展，实地参观和了解东莞国家城市湿地公园垂直流湿地在污水深度处理和水生态修复的原理和工艺过程等。然后参加身体照相机：用感官记录燕岭最美风景生态游戏。这是一个富有刺激、探险、激动的游戏，又是一个建立亲密关系的游戏，通过&ldquo;人体照相机&rdquo;这个活动，扮演照相机和摄影师两个角色，并将你拍到的照片冲洗出来，和分析你的心理历程。</p>\r\n', '陈盈莹', '13538392443', '0');
INSERT INTO `activities` VALUES ('198', '燕岭湿地寻宝之旅', '2018-09-22 08:30:00', '燕岭湿地', '2018-09-21 16:30:00', '40', '2018-09-22 11:30:00', '<p>1.认识常见植物及常见昆虫</p>\r\n\r\n<p>2.了解昆虫的基本知识</p>\r\n\r\n<p>3.昆虫在环境中的地位</p>\r\n\r\n<p>4.学会用手绘的方式来记录昆虫</p>\r\n\r\n<p><strong>活动对象</strong>：6岁以上的儿童和陪同家长,不接收6岁以下的儿童报名。</p>\r\n\r\n<p><strong>报名要求</strong>： 每个人都要独立报名（孩子同理），在孩子的报名表里填写清楚陪同监护人的姓名电话等信息。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('199', '2018年广东省观鸟培训', '2018-10-13 08:00:00', '东莞理工学院（松山湖校区）', '2018-10-08 16:00:00', '240', '2018-10-13 17:30:00', '<p>为了推广广东省的观鸟活动，配合东莞市委市政府建设&ldquo;美丽东莞&rdquo;的战略部署，建设幸福东莞，提升全市青少年儿童的环境公民意识和生态道德观念，由东莞市清洁生产科技中心主办，广东省环保宣传教育中心联合东莞市环保宣传教育中心、广州市阳光鸟会、东莞市观鸟协会、东莞理工学院、东莞松山湖绿色低碳发展促进中心协办的广东省观鸟培训（东莞专场）于2018年10月13日（星期六）在东莞理工学院松山湖校区举行，分室内培训和室外培训两部分。</p>\r\n\r\n<p>室内进行观鸟基础知识和经验分享，包括观鸟的基础、设备衣着的选择、听音辨识鸟类，马来西亚和新疆西藏观鸟经验分享</p>\r\n\r\n<p>室外进行飞羽寻踪环节，指导老师现场观鸟指导。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('200', '东莞市湿地保护与利用技术研讨会', '2018-10-18 08:40:00', '松山湖生态城市科普馆二楼会议室', '2018-10-17 16:30:00', '100', '2018-10-18 12:00:00', '<p>会议将邀请北京师范大学和暨南大学专家对河湖生态治理、人工湿地技术应用等进行专业讲解，并围绕东莞湿地保护与利用暨东莞国家城市湿地公园生态修复与开发利用经验进行交流.</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('201', '从自然观察到阅读写作', '2018-12-30 14:20:00', '东莞理工学院', '2018-12-29 16:00:00', '100', '2018-12-30 17:00:00', '<p>带领孩子做自然观察，再用文字的方式表达出来，是帮助孩子们对自己的观察进行思考、梳理。作为大人的我们，需要思考的是如何引导孩子进行观察，观察的内容是什么，如何获取讯息整合，如何进行思辨，如何扩展想象空间。写作是表达的一种方式，需要个性化想象的运化，才能成就为独特鲜活的作品。写作是输出，需要经过观察、阅读的积累与沉淀。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('202', '活动四：讲座——自然教育，与孩子一起茁壮成长', '2018-10-28 09:00:00', '松山湖生态城市科普馆', '2018-10-27 17:00:00', '100', '2018-10-28 11:30:00', '<p>本次活动中，郭老师会为您详细讲述自然教育的概念和内涵，近几年国内自然教育的发展趋势（数量、机构性质等），以及对体制教育的影响。</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('203', '活动二：培训——认识多彩生命，了解生物多样性', '2018-10-27 15:00:00', '松山湖生态城市科普馆及周边', '2018-10-26 17:00:00', '45', '2018-10-27 17:00:00', '<p>本活动中，郭老师将从介绍各种小生物入手，重点讲解身边的生物与自然，教你了解和动物、植物和环境的关系，以及如何利用仿生学原理，创造性的应用于日常生活。在培训讲解的基础上，郭老师还将带领大家走如户外，学习如何实地观察昆虫、植物、鸟等。</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('204', '活动三：夜观——夜幕下神秘的小精灵', '2018-10-27 19:30:00', '待定（在松山湖范围内，提前两天确定）', '2018-10-26 17:00:00', '20', '2018-10-27 21:00:00', '<p>月色溶溶夜，蛙鸣花草香。夜色中的大自然有着另类的美丽和神秘。一起来跟郭老师探寻夜间神秘的小精灵吧，认识奇妙的自然世界。</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('205', '活动一：观鸟——生态园大圳浦观鸟活动', '2018-10-27 07:00:00', '生态园大圳埔湿地', '2018-10-26 17:00:00', '35', '2018-10-27 10:30:00', '<p>本次活动中，郭老师从观察鸟类入手，一起探寻鸟类的生活奥秘。带你走进生态园大圳浦湿地，那里是鸟类的乐园，小小的区域内常见鸟类有50多种。郭老师将带你认识这些鸟类，同时还会引人入胜的讲解鸟类的语言、肢体动作和求偶繁殖等知识，以及与鸟类与植物之间的亲密关系。</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('206', '活动五：观虫——走进小小昆虫的大世界', '2018-10-28 15:00:00', '待定（在松山湖范围内，提前两天确定）', '2018-10-27 17:00:00', '40', '2018-10-28 17:00:00', '<p>本次活动中，郭老师将从认识小昆虫入手，教你如何认识自然、欣赏自然、喜欢自然，并告诉你许多野外考察和自然探险的经历与经验。小昆虫，大世界，昆虫的知识非常丰富，与你的日常生活息息相关，了解它们让你今后旅行多些情趣与内涵。</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('207', '讲座——揭开＂地球之肾＂的神秘面纱', '2018-11-03 08:30:00', '松山湖生态城市科普馆', '2018-11-02 17:00:00', '100', '2018-11-03 12:00:00', '<p>&nbsp; &nbsp; &nbsp;本次讲座特邀同济大学的程舟教授和华东师范大学的刘文亮教授围绕湿地多样的动植物，为我们讲述湿地生物的神奇特性、神奇的植物资源在生活中的应用以及湿地生物保护等知识，带您走进神奇的湿地生物世界，揭开地球之肾的神秘面纱，探索湿地生物世界的无穷奥秘。</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('208', '户外活动——湿地小生灵找找找', '2018-11-03 01:30:00', '松山湖中心公园', '2018-11-02 17:00:00', '50', '2018-11-03 03:30:00', '<p>本活动中，刘文亮老师和郭光普老师两位大专家带着各位小朋友来到自然湿地里，一起探巡水下泥土里精彩的生物世界，让孩子们体验未知的湿地世界，认识众生从未谋面的生物，或许你们在陆地上看到的他们在水下却有另一个＂前生＂。</p>\r\n', '陈同学', '13538392443', '0');
INSERT INTO `activities` VALUES ('209', '跟着植物学家探索热带雨林', '2018-11-25 09:00:00', '东莞松山湖管委会', '2018-11-24 23:00:00', '60', '2018-11-25 12:00:00', '<p>本次活动特邀中国科学院华南植物园的廖景平博士为大家讲述植物与人类生活，植物资利用源以及植物猎人和植物学家的故事，并带领大家前往东莞万科建筑技术研究有限公司的热带雨林馆实地观察，认识和了解热带雨林各种各样的植物，分享那些植物与人类生活、植物与植物间的故事。</p>\r\n', '林同学', '18719099795', '0');
INSERT INTO `activities` VALUES ('210', '“蝶影虫舞”大型昆虫生态科普公益活动', '2018-12-01 08:20:00', '东莞中学松山湖学校', '2018-11-30 16:00:00', '80', '2018-12-01 12:00:00', '<p>&nbsp; &nbsp; &nbsp; &nbsp;生活在这个时代的孩子们最大的幸福，就是可以自由地追逐自己的爱好，从小便享受着追逐梦想带来的快乐。小小科学家的诞生，往往源与一个自由发展兴趣爱好的童年。家长们能为孩子们的爱好做些什么呢？你可以给自己的孩子更多行动支持，一起来参加&ldquo;蝶影虫舞&rdquo;大型昆虫展览和户外观察活动吧！给热爱大自然的孩子们更多亲近、体验自然的机会。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('211', '2018谢岗银瓶湖湿地亲子观鸟培训活动', '2018-12-08 08:30:00', '筹建中的东莞市银瓶湖湿地公园（谢岗镇）', '2018-12-07 17:00:00', '50', '2018-12-08 11:00:00', '<p>为了提升全市青少年儿童的环境公民意识和生态道德观念，松山湖管委会联合东莞市观鸟协会于2018年12月8日（星期六）举办银瓶湖湿地公园户外亲子观鸟培训活动。</p>\r\n', '苏老师', '18926851729', '0');
INSERT INTO `activities` VALUES ('212', '秋水秋波秋鱼肥，一起来体验渔业文化吧！', '2018-12-01 14:30:00', '松山湖松木山水库', '2018-11-30 17:52:00', '20', '2018-12-01 17:00:00', '<p>渔业是人类早期直接向大自然索取食物的生产方式，是人类最早的产业行为，靠水吃水指的就是捕鱼。那么你知道渔民是如何捕鱼的吗？</p>\r\n\r\n<p>你知道松山湖最大的水库中有哪些鱼儿吗？每种鱼的差别吗？那么就和我们一起去一探究竟吧！</p>\r\n\r\n<p>本活动中，郭老师将带领大家乘船游览松木山水库，近距离观看捕鱼？了解捕鱼工具，认识松山湖里的鱼，认识鱼儿的生活秘密。</p>\r\n\r\n<p>郭老师还可以现场给大家讲授你不知道的鱼类知识</p>\r\n', '林同学', '18719099795', '0');
INSERT INTO `activities` VALUES ('213', '秋日飞羽，鸟儿的越冬准备', '2018-12-02 08:00:00', '松山湖滨湖路在水一方附近', '2018-11-30 20:00:00', '40', '2018-12-02 11:00:00', '<p>寒风起，候鸟归。你知道松山湖哪些地方才是小精灵们偏爱的越冬天堂吗？本次活动就让郭老师、黄老师和石老师三位观鸟专家带领大家去和远道而来的精灵鸟儿们在松山湖约会吧。</p>\r\n\r\n<p>本活动中，老师们将从观察鸟类入手，一起探寻鸟儿的生活奥秘。带你走进松山湖在水一方附近，带你认识这些鸟类，同时还会引人入胜的讲解鸟类的语言、肢体动作和求偶繁殖等知识，以及鸟儿们的越冬准备。</p>\r\n\r\n<p>在这里，你如果仔细观察，会看到鱼鹰、斑鱼狗等鸟类捕鱼的过程，值得期待吧。</p>\r\n', '林同学', '18719099795', '0');
INSERT INTO `activities` VALUES ('214', '探寻湿地生物链之间的奥秘', '2018-12-02 15:00:00', '生态园中央岛群', '2018-12-01 20:00:00', '40', '2018-12-02 17:00:00', '<p>湿地生物世界是个非常博大的世界，也是个妙趣横生的世界。湿地生物之间相互捕食和互利共生的关系更是错综复杂，复杂是食物链和食物网，是生态系统稳定的基础，也是地球生命不断繁衍而又不断进化的奥秘，令人惊奇！</p>\r\n\r\n<p>本次活动郭老师将带领大家走进生态园中央岛群，为我们讲述湿地生物之间相互捕食和互利共生的特殊关系，湿地生物的神奇特性，以及湿地生物在环境保护、日常应用以及湿地生物保护等知识，带您走进神奇的湿地生物世界，画出您所理解的湿地生物链，一同来揭开湿地生物链之间的神秘面纱，探索湿地生物世界的无穷奥秘。</p>\r\n', '林同学', '18719099795', '0');
INSERT INTO `activities` VALUES ('215', '走进国家城市湿地公园，用自然作画，让自然美颜', '2018-12-01 15:00:00', '松山湖生态园风景区', '2018-11-30 18:00:00', '30', '2018-12-01 17:30:00', '<p>1.把你家孩子打扮得漂漂亮亮，我们专业的摄影记者会为你家孩子拍出美美的照片</p>\r\n\r\n<p>2.妈妈们必须带两道以上的菜点（卤味、面包、甜点、主食等任你发挥），孩子只负责好好玩，好好吃</p>\r\n', '林同学', '18719099795', '0');
INSERT INTO `activities` VALUES ('216', '探秘松湖上空 寻找松湖的最美冬天', '2018-12-09 08:30:00', '松山湖自然生态园风景区', '2018-12-07 20:00:00', '36', '2018-12-09 12:00:00', '<h2>松山湖自然生态园是东莞的&ldquo;城市之肾&rdquo;已形成了以城市湿地为核心的生态系统和景观体系，是市民们休闲娱乐的一个绝佳场所。让我们在无人机镜头的帮助下从天空俯瞰生态园整体面貌、用相机去扑捉生态园陆地生态特征，根据天空与地面不同角度的对比带领孩子深入了解东莞十多年来自然生态环境建设的成果。</h2>\r\n', '刘小姐', '13528614298', '0');
INSERT INTO `activities` VALUES ('217', '松山湖自然笔记培训活动', '2018-12-09 08:45:00', '松山湖生态城市科普馆', '2018-12-07 20:38:00', '40', '2018-12-09 12:00:00', '<p>自然笔记培训</p>\r\n', '林同学', '18719099795', '0');
INSERT INTO `activities` VALUES ('218', '把自然印下来，“袋”在身边把自然印下来，“袋”在身边', '2018-12-15 09:30:00', '松山湖管委会A3栋一楼会议室', '2018-12-14 17:00:00', '38', '2018-12-15 11:30:00', '<p><strong>松山湖绿色低碳发展促进中心和妈咪HOME亲子平台</strong>希望向孩子们传递一种环保的理念，培养孩子们的环保意识，少用一次性袋子&mdash;&mdash;其实只要你用点心，便可以制出超美的个性环保袋，用着这样的袋子，可比一次性袋子&ldquo;酷多了&rdquo;。</p>\r\n', '查老师', '13929403042', '0');
INSERT INTO `activities` VALUES ('219', '共同学习交流：让鸟类和野生动物进城，我们该如何做？', '2019-01-15 09:30:00', '松山湖生态城市科普馆二楼会议室    ', '2019-01-14 17:00:00', '50', '2019-01-15 11:30:00', '<p>为了保护城市鸟类和其他城市野生动物资源，打造人与自然和谐的格局，亟待进行城市生物多样性的恢复，尤其是鸟类恢复与招引。本月15日（周二）上午，松山湖绿色低碳发展促进中心将邀请广东省生物资源应用研究所的胡慧建研究员对城市动物多样性恢复技术体系、方法进行系统讲解，结合相关案例重点介绍城市野生鸟类招引与恢复，诚邀热爱自然的社会人士参加，让我们一起来学习和了解如何招引鸟类，丰富城市自然生态环境。</p>\r\n', '郭秋红', '13712222392', '0');
INSERT INTO `activities` VALUES ('220', '昆虫观察', '2019-01-12 09:00:00', '东莞理工学院（松山湖校区）', '2019-01-11 16:00:00', '20', '2019-01-12 11:30:00', '<p>冬天，有昆虫吗？</p>\r\n\r\n<p>冬天，虫虫出没在哪里？</p>\r\n\r\n<p>冬天，跟着李琨渊和李琦老师，</p>\r\n\r\n<p>一起寻找冬天里的生命。</p>\r\n', '李老师', '15818331206', '0');
INSERT INTO `activities` VALUES ('221', '松湖飞羽 灵动生命-冬季观鸟导赏活动', '2019-01-24 04:30:00', '东莞理工学院（松山湖校区）', '2019-01-23 16:00:00', '10', '2019-01-24 06:30:00', '<p>从鸟的结构等角度来进行观鸟，并且指导如何撰写自然观察笔记。</p>\r\n', '李老师', '15818331206', '0');
